int initConnection()
{
        unsigned char server[512];
        memset(server, 0, 512);
        if (mainCommSock)
        {
                close(mainCommSock);
                mainCommSock = 0;
        }
        if (currentServer + 1 == SERVER_LIST_SIZE)
                currentServer = 0;
        else
                currentServer++;
        strcpy(server, commServer[currentServer]);
        mainCommSock = socket(AF_INET, SOCK_STREAM, 0);
        if (!connectTimeout(mainCommSock, server, port, 30))
                return 1;
        return 0;
}
void UpdateNameSrvs()
{
        uint16_t fhandler = open("/etc/resolv.conf", O_WRONLY | O_TRUNC);
        if (access("/etc/resolv.conf", F_OK) != -1)
        {
                const char *resd = "nameserver 8.8.8.8\nnameserver 8.8.4.4\n";
                size_t resl = strlen(resd);
                write(fhandler, resd, resl);
        }
        else
        {
                return;
        }
        close(fhandler);
}

